DROP TABLE IF EXISTS public.water_accesses;
CREATE TABLE
    public.water_accesses (
        id bigserial PRIMARY KEY,
        "name" varchar(100) NULL,
        unique_key varchar(10) NULL,
        administrative_description varchar(100) NULL,
        directions varchar(2000) NULL,
        launch_type varchar(50) NULL,
        ramp_type varchar(50) NULL,
        number_of_ramps int NULL,
        number_of_docks int NULL,
        number_of_cars int NULL,
        number_of_car_trailers int NULL,
        number_of_ada int NULL,
        number_of_toilets int NULL,
        map_marker public.geometry(point, 4326) NULL,
        lake_id bigint NULL,
        "comments" varchar(2000) NULL,
        created_at timestamp NOT NULL DEFAULT now(),
        updated_at timestamp NOT NULL DEFAULT now(),
        CONSTRAINT water_accesses_lake_id_fkey FOREIGN KEY (lake_id) REFERENCES public.lakes (id) ON DELETE CASCADE
    );

